import React from 'react'
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom'
import Login from './Screen/Login'

const Routers = () => {
  return (
    <Router>
        <Routes>
            <Route path='/' component={<Login/>}/>
        </Routes>
    </Router>
  )
}

export default Routers
